import numpy as np
class Solution:
    def maximumProduct(self, nums: list[int], k: int) -> int:
        mo = int(10e8 + 7)
        nums = sorted(nums)
        pivot = 1
        while k > 0:
            if pivot >= len(nums) - 1:
                pivot = len(nums) - 1
                
                if nums[pivot-1] == nums[pivot]:
                    k-= 1
                    nums[pivot] += 1
            diff = nums[pivot] - nums[pivot-1]
            if diff > 0:
                if k >= diff * pivot:
                    k -= diff * pivot
                    for i in range(pivot):
                        nums[i] += diff
                else:
                    a = k // pivot
                    k -= a*pivot
                    for i in range(pivot):
                        nums[i] += a + 1 * (i < k)
                    break
            else:
                pivot += 1

        p = 1
        for i in nums:
            p*=i
            if i%2 == 0:
                p%=mo
        p%=mo

        return p


